  false,\n\t\"url\": null,\n\t\"notes\": \"Since 1995, the White House has been required
  to deliver a report to Congress listing the title and salary of every White House
  Office employee. Consistent with President Obama's commitment to transparency, this
  report is being publicly disclosed on our website as it is transmitted to Congress.
  In addition, this report also contains the title and salary details of administration
  officials who work at the Office of Policy Development, including the Domestic Policy
  Council and the National Economic Council -- along with White House Office employees.
  Note: Salaries listed do not reflect salary reductions staff have taken due to furloughs
  and commissioned officer salary reductions.\",\n\t\"license_title\": \"License Not
